import React from "react";

function Snake({ snakeDots }) {
	return (
		<div>
			{props.snakeDots.map((dot, i) => {
				const style = {
					left: `${dot[0]}%`,
					top: `${dot[1]}%`,
				};
				return <div className="snake__dot" key={i} style={style}></div>;
			})}
		</div>
	);
}

export default Snake;
